  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Upper Mississippi
  River Wildlife and Fish Refuge outlines Refuge accomplishments from January through
  April of 1943. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and violations. Items of interest, N-R forms, and photographs are attached. This
  report also cover a summarization of refuge activities from July 1, 1942 to April
  30, 1943.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
